// React
import React from "react";

//Import CSS
import "./ServicesCard.css";

import ServicesItem from "./servicesItem/ServicesItem";

const ServicesCard = () => {
  return (
    <>
    <h1>Services</h1>
      <div className="wrapper">
        <ServicesItem number="1" />
        <ServicesItem number="2" />
        <ServicesItem number="3" />
        <ServicesItem number="4" />
        <ServicesItem number="5" />
        <ServicesItem number="6" />
      </div>
    </>
  );
};

export default ServicesCard;
